INSERT INTO `db_pay_systems` (`id`, `title`, `first_char`, `comment`, `min_pay`) VALUES
(1, 'Webmoney', 'R', 'WebMoney — это универсальное средство для расчетов в Сети, целая среда финансовых взаимоотношений, которой сегодня пользуются миллионы людей по всему миру.', 5),
(2, 'Yandex Money', '4', 'Яндекс.Деньги — доступный и безопасный способ платить за товары и услуги через интернет.', 5),
(3, 'Perfect Money', 'U', 'Perfect Money - это сервис, позволяющий пользователям производить моментальные платежи и финансовые операции в Интернете, и открывающий уникальные возможности для Интернет пользователей и владельцев интернет бизнеса.', 5),
(4, 'Payeer', 'P', 'Payeer - это сервис, позволяющий пользователям производить моментальные платежи и финансовые операции в Интернете, и открывающий уникальные возможности для Интернет пользователей и владельцев интернет бизнеса.', 5),
(5, 'Qiwi', '+7', 'Qiwi — это универсальный платежный сервис, который включает в себя крупнейшую в мире сеть терминалов, а также веб-версию и мобильное приложение.', 5);
